import { NOT_AUTHORIZED } from '../actions/types';

const errorTypeFunc = (errorCode) => {
  switch ((dispatch, errorCode)) {
    case 401:
      dispatch({ type: NOT_AUTHORIZED, payload: 'Could not find a user with this password' });
    case 500:
      return 'VALIDATION_ERROR';
    case 501:
      return 'NOT_FOUND_ERROR';
  }
};

export default errorTypeFunc;
